	@Test
	public void testRegisterAction() {
		this.registry.registerAction(this.path, this.mockAction);
		RESTAction action = this.registry.getAction(this.path);
		assertNotNull("Could not retrieve action back", action);
		assertEquals("Registered action is the wrong action", action,
				this.mockAction);
		action.invoke(null, null, null);
	}

